5\u0442\u0432\u0435\u0440\u0442\u044b\u0439 \u0433\u043e\u0434 \u044f \u0438\u0437\u0443\u0447\u0430\u044e \u043c\u0435\u0442\u043e\u0434\u044b \u0440\u0430\u0431\u043e\u0442\u044b \u0441 \u044d\u043c\u043e\u0446\u0438\u044f\u043c\u0438 \u0438 \u0442\u0440\u0435\u0432\u043e\u0433\u043e\u0439. \n\u2800 \n\u0418 \u043c\u043e\u0433\u0443 \u043f\u043e\u0434\u0435\u043b\u0438\u0442\u044c\u0441\u044f, \u0447\u0442\u043e \u0444\u043e\u043d\u043e\u0432\u0430\u044f \u0442\u0440\u0435\u0432\u043e\u0433\u0430, \u0438\u0437\u0432\u043e\u0434\u0438\u0432\u0448\u0430\u044f \u043c\u0435\u043d\u044f \u043f\u043e\u0447\u0442\u0438 \u043a\u0430\u0436\u0434\u044b\u0439 \u0434\u0435\u043d\u044c \u0431\u043e\u043b\u044c\u0448\u0435 3 \u043b\u0435\u0442, \u043f\u0440\u043e\u0448\u043b\u0430. \u0411\u0435\u0437 \u0442\u0430\u0431\u043b\u0435\u0442\u043e\u043a, \u043d\u043e \u043f\u0443\u0442\u044c \u0431\u044b\u043b \u043d\u0435\u043f\u0440\u043e\u0441\u0442\u044b\u043c, \u0437\u0430\u043d\u044f\u043b \u043c\u043d\u043e\u0433\u043e \u0432\u0440\u0435\u043c\u0435\u043d\u0438, \u0430 \u0442\u0430\u043a\u0436\u0435 \u0434\u0435\u043d\u0435\u0433 \u043d\u0430 \u043a\u043e\u043d\u0441\u0443\u043b\u044c\u0442\u0430\u0446\u0438\u0438 \u0441\u043f\u0435\u0446\u0438\u0430\u043b\u0438\u0441\u0442\u043e\u0432 \u0438 \u043e\u0431\u0443\u0447\u0435\u043d\u0438\u0435. \u0418 \u0431\u043e\u043b\u044c\u0448\u043e\u0439 \u0434\u0443\u0445\u043e\u0432\u043d\u044b\u0439 \u0440\u043e\u0441\u0442 \u043d\u0438\u043a\u0442\u043e \u043d\u0435 \u043e\u0442\u043c\u0435\u043d\u044f\u043b.\n\u2800 \n\u0416\u0438\u0437\u043d\u044c \u0432 \u0442\u0440\u0435\u0432\u043e\u0433\u0435 - \u043e\u0447\u0435\u043d\u044c \u0438\u0441\u0442\u043e\u0449\u0430\u0435\u0442, \u043d\u0435 \u0434\u0430\u0451\u0442 \u0437\u0434\u0440\u0430\u0432\u043e \u0432\u0438\u0434\u0435\u0442\u044c \u043c\u0438\u0440 \u0438 \u043b\u044e\u0434\u0435\u0439, \u0430 \u0437\u043d\u0430\u0447\u0438\u0442 \u0441\u0442\u0440\u043e\u0438\u0442\u044c \u043f\u043b\u0430\u043d\u044b \u043d\u0430 \u0431\u0443\u0434\u0443\u0449\u0435\u0435. \u0421\u0435\u0439\u0447\u0430\u0441 \u043a\u043e\u0433\u0434\u0430 \u043e\u043d\u0430 \u043f\u043e\u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u0432 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u0435 \u0441\u0442\u0440\u0435\u0441\u0441\u043e\u0432\u044b\u0445 \u0441\u0438\u0442\u0443\u0430\u0446\u0438\u0439 \u0438\u043b\u0438 \u0438\u0437 \u043d\u0438\u043e\u0442\u043a\u0443\u0434\u0430, \u0442\u043e \u044f \u0445\u043e\u0440\u043e\u0448\u043e \u0441\u043f\u0440\u0430\u0432\u043b\u044f\u044e\u0441\u044c, \u043d\u043e \u0440\u0430\u043d\u044c\u0448\u0435 \u0431\u044b\u043b\u043e \u043d\u0435 \u0442\u0430\u043a. \n\u2800 \n\u041a\u0430\u043a \u0447\u0430\u0441\u0442\u043e \u0432\u044b \u0438\u0441\u043f\u044b\u0442\u044b\u0432\u0430\u0435\u0442\u0435 \u0442\u0440\u0435\u0432\u043e\u0433\u0443? \u0420\u0430\u0441\u0441\u043a\u0430\u0437\u0430\u0442\u044c \u043f\u043e\u0434\u0440\u043e\u0431\u043d\u0435\u0435 \u043e \u043c\u043e\u0435\u043c \u043e\u043f\u044b\u0442\u0435 \u0438 \u0447\u0442\u043e \u043c\u043d\u0435 \u043f\u043e\u043c\u043e\u0433\u043b\u043e? \u0410\u043a\u0442\u0443\u0430\u043b\u044c\u043d\u043e \u0434\u043b\u044f \u0432\u0430\u0441?\n\u2800 \nP.S. \u042d\u0442\u0438 \u0434\u0443\u0448\u0435\u0432\u043d\u044b\u0435 \u0441\u043d\u0438\u043c\u043a\u0438 \u043e\u0442 \u043f\u0440\u0435\u043a\u0440\u0430\u0441\u043d\u043e\u0433\u043e \u0434\u0443\u044d\u0442\u0430 \u0444\u043e\u0442\u043e\u0433\u0440\u0430\u0444\u043e\u0432 @naedine_mv \u0433\u043e\u0432\u043e\u0440\u044f\u0442 \u043e\u0431\u043e \u043c\u043d\u0435 \u0438 \u043c\u043e\u0435\u043c \u0434\u0443\u0448\u0435\u0432\u043d\u043e\u043c \u0441\u043e\u0441\u0442\u043e\u044f\u043d\u0438\u0438 \u0441\u0430\u043c\u0438 \u0437\u0430 \u0441\u0435\u0431\u044f. \u041a\u0441\u0442\u0430\u0442\u0438, 20 \u0430\u043f\u0440\u0435\u043b\u044f \u0434\u0435\u0432\u0443\u0448\u043a\u0438 \u0431\u0443\u0434\u0443\u0 435\u0441\u0441\u043e\u0432\u044b\u0445 \u0441\u0438\u0442\u0443\u0430\u0446\u0438\u0439. \u042f \u0437\u043d\u0430\u044e, \u0447\u0442\u043e \u0442\u0430\u043a\u043e\u0435 \u0444\u0430\u043a\u0430\u043f\u044b \u0432 \u0431\u0438\u0437\u043d\u0435\u0441\u0435, \u043d\u0435\u0441\u043a\u043e\u043b\u044c\u043a\u043e \u0440\u0430\u0437 \u0432 \u0433\u043e\u0434 \u0441\u043b\u0443\u0447\u0430\u044e\u0442\u0441\u044f \u0440\u0430\u0437\u043e\u0447\u0430\u0440\u043e\u0432\u0430\u043d\u0438\u044f \u0432 \u043b\u044e\u0434\u044f\u0445, \u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u043c\u0430\u043c\u0430 \u043d\u0430\u0437\u044b\u0432\u0430\u0435\u0442 \u0441\u0430\u043c\u044b\u043c \u0431\u043e\u043b\u0435\u0437\u043d\u0435\u043d\u043d\u044b\u043c \u0436\u0438\u0437\u043d\u0435\u043d\u043d\u044b\u043c \u043e\u043f\u044b\u0442\u043e\u043c. \u041e\u0442\u0441\u044e\u0434\u0430 \u0438\u043d\u043e\u0433\u0434\u0430 \u0438 \u043f\u0440\u043e\u0431\u043b\u0435\u043c\u044b \u0441\u043e \u0437\u0434\u043e\u0440\u043e\u0432\u044c\u0435\u043c. \n\u2800 \n\u041f\u043b\u044e\u0441 \u044f \u0434\u0430\u043b\u0435\u043a\u043e \u043d\u0435 \u043c\u0430\u0441\u0442\u0435\u0440 \u0434\u0437\u0435\u043d\u0430, \u0435\u0441\u0442\u044c \u043e\u0441\u043e\u0431\u0435\u043d\u043d\u043e\u0441\u0442\u0438 \u0434\u0435\u0442\u0441\u0442\u0432\u0430 \u0438 \u043f\u0440\u043e\u0448\u043b\u043e\u0433\u043e \u043e\u043f\u044b\u0442\u0430, \u0441 \u043a\u043e\u0442\u043e\u0440\u044b\u043c\u0438 \u044f \u0440\u0430\u0431\u043e\u0442\u0430\u044e. \u041f\u0440\u043e\u0446\u0435\u0441\u0441 \u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u044f \u043b\u0438\u0447\u043d\u043e\u0441\u0442\u0438 \u043d\u0435 \u0437\u0430\u043a\u0430\u043d\u0447\u0438\u0432\u0430\u0435\u0442\u0441\u044f \u043d\u0438\u043a\u043e\u0433\u0434\u0430 \u0438 \u044f \u043e\u0447\u0435\u043d\u044c \u0441\u0442\u0430\u0440\u0430\u044e\u0441\u044c \u0431\u044b\u0442\u044c \u043b\u0443\u0447\u0448\u0435 \u0434\u043b\u044f \u0441\u0430\u043c\u043e\u0439 \u0441\u0435\u0431\u044f \u0438 \u0434\u0440\u0443\u0433\u0438\u0445, \u043f\u0435\u0440\u0435\u0445\u043e\u0434\u044f \u043d\u0430 \u0431\u043b\u0430\u0433\u043e\u0434\u0430\u0440\u043d\u043e\u0441\u0442\u044c \u0434\u0430\u0436\u0435 \u043f\u043e\u0441\u043b\u0435 \u043e\u0447\u0435\u043d\u044c \u043d\u0435\u043f\u0440\u0438\u044f\u0442\u043d\u044b\u0445 \u0441\u0438\u0442\u0443\u0430\u0446\u0438\u0439. \n\u2800 \n\u041a\u0430\u0436\u0434\u044b\u0439 \u0440\u0430\u0437, \u043a\u043e\u0433\u0434\u0430 \u0441\u043f\u0443\u0441\u043a\u0430\u044e\u0441\u044c \u0431\u043b\u0438\u0436\u0435 \u043a\u0442\u043e \u0434\u043d\u0443, \u0442\u043e \u043f\u043e\u043d\u0438\u043c\u0430\u044e, \u0447\u0442\u043e \u043f\u0435\u0440\u0438\u043e\u0434 \u0430\u043a\u0442\u0438\u0432\u043d\u044b\u0445 \u043b\u0435\u0442 \u0436\u0438\u0437\u043d\u0438 \u043e\u0433\u0440\u0430\u043d\u0438\u0447\u0435\u043d, \u043e\u0441\u043e\u0431\u0435\u043d\u043d\u043e, \u043a\u043e\u0433\u0434\u0430 \u0432\u044b\u0447\u0438\u0442\u0430\u044e 30, \u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u0443\u0436\u0435 \u043f\u0440\u043e\u0436\u0438\u043b\u0430. \u041e\u0441\u043e\u0437\u043d\u0430\u044e, \u0447\u0442\u043e \u00ab\u0435\u0441\u043b\u0438 \u043d\u0435 \u044f, \u0442\u043e \u043d\u0438\u043a\u0442\u043e\u00bb \u043d\u0435 \u0441\u043e\u0437\u0434\u0430\u0441\u0442 \u043a\u0440\u0430\u0441\u0438\u0432\u0443\u044e \u0436\u0438\u0437\u043d\u044c \u0441 \u043f\u0443\u0442\u0435\u0448\u0435\u0441\u0442\u0432\u0438\u044f\u043c\u0438 \u0438 \u043a\u043b\u0430\u0441\u0441\u043d\u044b\u043c\u0438 \u043b\u044e\u0434\u044c\u043c\u0438, \u043d\u0435 \u0432\u043e\u0437\u044c\u043c\u0451\u0442 \u043e\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0441\u0442\u044c \u0437\u0430 \u043c\u0430\u043c\u0443 \u0438\u043d\u0432\u0430\u043b\u0438\u0434\u0430. \u0422\u043e\u043b\u044c\u043a\u043e \u044f \u043c\u043e\u0433\u0443 \u0432\u0438\u0434\u0435\u0442\u044c \u0432\u043e\u0437\u043c\u043e\u0436\u043d\u043e\u0441\u0442\u0438 \u0438 \u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u044c\u0441\u044f \u0438\u043c\u0438, \u0440\u0430\u0441\u0442\u0438 \u0434\u043e \u043d\u0438\u0445, \u0430 \u043c\u043e\u0433\u043b\u0430 \u0431\u044b \u043e\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0442\u044c\u0441\u044f \u0435\u0449\u0435 \u043d\u0430 \u044d\u0442\u0430\u043f\u0435 \u043e\u0436\u0438\u0440\u0435\u043d\u0438\u044f \u0438\u043b\u0438 \u0431\u0435\u0434\u043d\u043e\u0441\u0442\u0438, \u0438\u043b\u0438 \u043d\u0435\u0441\u0447\u0430\u0441\u0442\u043b\u0438\u0432\u044b\u0445 \u043e\u0442\u043d\u043e\u0448\u0435\u043d\u0438\u0439, \u0438\u043b\u0438 \u043f\u0435\u0440\u0432\u043e\u0433\u043e \u043d\u0435\u0443\u0434\u0430\u0432\u0448\u0435\u0433\u043e\u0441\u044f \u0431\u0438\u0437\u043d\u0435\u0441 \u043f\u0440\u043e\u0435\u043a\u0442\u0430.\n\u2800 \n\u042f \u043b\u043e\u0436\u0443\u0441\u044c \u0440\u0430\u043d\u043e, \u0432\u0441\u0442\u0430\u044e \u0440\u0430\u043d\u043e, \u0434\u0435\u043b\u0430\u044e \u0437\u0430\u0440\u044f\u0434\u043a\u0443, \u043c\u0435\u0434\u0438\u0442\u0438\u0440\u0443\u044e, \u043a\u0430\u0436\u0434\u044b\u0439 \u0434\u0435\u043d\u044c \u0443\u0447\u0443\u0441\u044c, \u043f\u043e\u0434\u0434\u0435\u0440\u0436\u0438\u0432\u0430\u044e \u043a\u043e\u043d\u0442\u0430\u043a\u0442 \u0441 \u043e\u0433\u0440\u0430\u043d\u0438\u0447\u0435\u043d\u043d\u044b\u043c \u043a\u043e\u043b\u0438\u0447\u0435\u0441\u0442\u0432\u043e\u043c \u043b\u044e\u0434\u0435\u0439, \u043e\u0431\u0449\u0435\u043d\u0438\u0435 \u0441 \u043a\u043e\u0442\u043e\u0440\u044b\u043c\u0438 \u043d\u0430\u043f\u043e\u043b\u043d\u044f\u0435\u0442, \u0441\u0442\u0430\u0432\u043b\u044e \u043d\u043e\u0432\u044b\u0435 \u0446\u0435\u043b\u0438 \u0432 \u0440\u0430\u0431\u043e\u0442\u0435, \u043f\u043e \u043a\u0440\u0443\u043f\u0438\u0446\u0430\u043c \u0441\u043e\u0431\u0438\u0440\u0430\u044f \u0437\u043d\u0430\u043d\u0438\u044f \u0438 \u043b\u044e\u0434\u0435\u0439, \u0447\u0442\u043e\u0431\u044b \u043f\u043e\u0434\u043d\u044f\u0442\u044c\u0441\u044f \u043d\u0430 \u0441\u0442\u0443\u043f\u0435\u043d\u044c\u043a\u0443 \u0432\u044b\u0448\u0435. \u042d\u0442\u043e \u043f\u043e\u043c\u043e\u0433\u0430\u0435\u0442 \u043c\u043d\u0435 \u0431\u044b\u0442\u044c \u0432 \u043e\u043a\u0440\u0443\u0436\u0435\u043d\u0438\u0438 \u043b\u044e\u0434\u0435\u0439, \u043a\u043e\u0442\u043e\u0440\u044b\u043c\u0438 \u044f \u0432\u0434\u043e\u0445\u043d\u043e\u0432\u043b\u044f\u044e\u0441\u044c, \u0438 \u0431\u044b\u0442\u044c \u0442\u0430\u043a\u0438\u043c \u0436\u0435 \u0438\u0441\u0442\u043e\u0447\u043d\u0438\u043a\u043e\u043c \u0434\u043b\u044f \u043d\u0438\u0445. \u041e\u043d\u0438 \u0442\u0430\u043a \u0433\u043e\u0432\u043e\u0440\u044f\u0442, \u044f \u043d\u0435 \u0441\u0430\u043c\u0430 \u044d\u0442\u043e \u043f\u0440\u0438\u0434\u0443\u043c\u0430\u043b\u0430.\n\u2800 \n\u042d\u0442\u043e \u0441\u043b\u043e\u0436\u043d\u043e, \u0438\u043d\u043e\u0433\u0434\u0430 \u0441\u0442\u0440\u0430\u0448\u043d\u043e, \u043e\u0441\u043e\u0431\u0435\u043d\u043d\u043e, \u043a\u043e\u0433\u0434\u0430 \u0437\u0430\u043c\u0430\u0445\u0438\u0432\u0430\u0435\u0448\u044c\u0441\u044f \u043d\u0430 \u0442\u043e, \u0447\u0442\u043e \u043d\u0435 \u0437\u043d\u0430\u0435\u0448\u044c, \u043d\u043e \u044f \u0438\u0434\u0443 \u0438 \u0434\u0435\u043b\u0430\u044e, \u043f\u0440\u043e\u0440\u0430\u0431\u0430\u0442\u044b\u0432\u0430\u044f \u043d\u0435\u0443\u0432\u0435\u0440\u0435\u043d\u043d\u043e\u0441\u0442\u044c \u0432\u043d\u0443\u0442\u0440\u0438, \u043e\u0442\u043a\u0440\u044b\u0432\u0430\u044f\u0441\u044c \u043d\u043e\u0432\u043e\u043c\u0443 \u043e\u043f\u044b\u0442\u0443 \u0438 \u043b\u044e\u0434\u044f\u043c. \u041c\u043d\u043e\u0433\u043e \u0443\u0447\u0443\u0441\u044c, \u043f\u043e\u0442\u043e\u043c\u0443 \u0447\u0442\u043e \u041c\u041d\u0415 \u044d\u0442\u043e \u043d\u0430\u0434\u043e, \u043d\u0435 \u043a\u043e\u043c\u0443-\u0442\u043e \u0434\u0440\u04 430\u0440\u0443\u0441\u0435\u043b\u0438 \u043f\u0440\u043e \u0442\u043e, \u0447\u0442\u043e \u044f \u0432\u044b\u0431\u0438\u0440\u0430\u044e \u0441\u0435\u0439\u0447\u0430\u0441. \u041b\u043e\u0432\u0438\u043c \u0431\u0430\u043b\u0430\u043d\u0441, \u0434\u0440\u0443\u0437\u044c\u044f.\n\u2800 \n\u041d\u044b\u043d\u0447\u0435 \u044f \u043d\u0435\u043c\u043d\u043e\u0433\u043e grand ma, \u043c\u043d\u0435 \u0437\u0430\u0449\u0435\u043c\u0438\u043b\u043e \u043d\u0435\u0440\u0432 \u0438 \u043c\u043e\u0438 \u0432\u0435\u0447\u0435\u0440\u0438\u043d\u043a\u0438 \u043f\u0440\u043e\u0445\u043e\u0434\u044f\u0442 \u043d\u0435 \u0432 \u0440\u0435\u0441\u0442\u043e\u0440\u0430\u043d\u0430\u0445, \u0430 \u0441 \u0438\u043d\u0434\u0443\u0441\u0430\u043c\u0438 \u0438 \u043f\u0440\u043e\u0433\u0440\u0435\u0432\u0430\u043d\u0438\u0435\u043c \u0442\u0440\u0430\u0432\u044f\u043d\u044b\u043c\u0438 \u043c\u0435\u0448\u043e\u0447\u043a\u0430\u043c\u0438. \u041e\u0447\u0435\u043d\u044c \u0434\u0430\u0436\u0435!\n\u2800 \n\u0421\u0435\u0433\u043e\u0434\u043d\u044f \u0438 \u0432\u043e\u0432\u0441\u0435 \u043c\u043d\u0435 \u043d\u0430 \u0441\u043f\u0438\u043d\u0443 \u043f\u043e\u0441\u0442\u0430\u0432\u0438\u043b\u0438 2 \u0432\u043e\u0440\u043e\u043d\u043a\u0438 \u0438\u0437 \u0442\u0435\u0441\u0442\u0430, \u0437\u0430\u043b\u0438\u043b\u0438 \u0433\u043e\u0440\u044f\u0447\u0435\u0435 \u0430\u044e\u0440\u0432\u0435\u0434\u0438\u0447\u0435\u0441\u043a\u043e\u0435 \u043c\u0430\u0441\u043b\u043e \u043d\u0430 \u043f\u043e\u043b\u0447\u0430\u0441\u0430, \u043d\u0430\u043a\u0430\u0437\u0430\u0432 \u043b\u0435\u0447\u044c \u0441\u043f\u0430\u0442\u044c \u043a\u0430\u043a \u043c\u043e\u0436\u043d\u043e \u0440\u0430\u043d\u044c\u0448\u0435. \n\u2800 \n\u0415\u0441\u043b\u0438 \u0438\u043d\u0442\u0435\u0440\u0435\u0441\u043d\u043e, \u0442\u043e \u044f \u043e\u0431\u044f\u0437\u0430\u0442\u0435\u043b\u044c\u043d\u043e \u043f\u043e\u0434\u0435\u043b\u044e\u0441\u044c \u0442\u0435\u043c, \u043a\u0430\u043a \u044f \u0441\u043f\u0440\u0430\u0432\u0438\u043b\u0430\u0441\u044c \u0441 \u0437\u0430\u0449\u0435\u043c\u043b\u0435\u043d\u0438\u0435\u043c \u043d\u0435\u0440\u0432\u0430 \u0438 \u0447\u0442\u043e \u0431\u0443\u0434\u0443 \u0434\u0435\u043b\u0430\u0442\u044c \u0434\u0430\u043b\u044c\u0448\u0435. \u042f \u0432 \u044d\u0442\u043e\u043c \u043d\u0435 \u0432 \u043f\u0435\u0440\u0432\u044b\u0439 \u0440\u0430\u0437 \u0438\u0431\u043e \u043c\u043e\u043b\u043e\u0434\u043e\u0441\u0442\u044c, \u043f\u0435\u0440\u0438\u043e\u0434 \u0436\u0435\u0441\u0442\u043a\u043e\u0433\u043e \u0432\u044b\u0436\u0438\u0432\u0430\u043d\u0438\u044f \u0438 \u0440\u0430\u0431\u043e\u0442\u0430 \u043d\u0430 \u0441\u043a\u043b\u0430\u0434\u0435 \u0441 \u043f\u043e\u0434\u043d\u044f\u0442\u0438\u0435\u043c \u0442\u044f\u0436\u0435\u0441\u0442\u0435\u0439 \u043d\u0435 \u043f\u0440\u043e\u0448\u043b\u0438 \u043c\u0438\u043c\u043e, \u0432\u0441\u044f\u043a\u043e\u0435 \u0431\u044b\u0432\u0430\u043b\u043e. \u041a\u043e\u0440\u043e\u0447\u0435 \u0432\u0435\u0447\u0435\u0440\u0438\u043d\u043a\u0438 \u0437\u0430 30 \u0440\u0430\u0437\u043d\u044b\u0435 \u0431\u044b\u0432\u0430\u044e\u0442, \u043d\u043e \u043c\u044b \u0441\u043f\u0440\u0430\u0432\u0438\u043c\u0441\u044f. \u0417\u041e\u0416\ud83e\udd1f\ud83c\udffb"}}]},"edge_media_to_comment":{"count":97},"comments_disabled":false,"taken_at_timestamp":1617390326,"edge_liked_by":{"count":2109},"edge_media_preview_like":{"count":2109},"location":{"id":"405115560","has_public_page":true,"name":"Big Wine Freaks","slug":"big-wine-freaks"},"thumbnail_src":"https://instagram.feoh5-1.fna.fbcdn.net/v/t51.2885-15/sh0.08/e35/c0.90.720.720a/s640x640/167389106_207402011153760_4329823147914425520_n.jpg?tp=1\u0026_nc_ht=instagram.feoh5-1.fna.fbcdn.net\u0026_nc_cat=100\u0026_nc_ohc=4Z-9Z8OTuUQAX_LWYDB\u0026edm=ABfd0MgAAAAA\u0026ccb=7-4\u0026oh=48e02bfde2170ba5ccc920b8b6e23711\u0026oe=6070EC73\u0026_nc_sid=7bff83","thumbnail_resources":[{"src":"https://instagram.feoh5-1 43a\u0438\u0445 \u043a\u0430\u043a, \u043d\u0430\u043f\u0440\u0438\u043c\u0435\u0440, \u0432\u043d\u0435\u0448\u043d\u0435 \u043f\u0440\u0438\u0432\u043b\u0435\u043a\u0430\u0442\u0435\u043b\u044c\u043d\u0430\u044f \u0435\u0434\u0430 \u0438\u043b\u0438 \u0444\u0438\u0437\u0438\u0447\u0435\u0441\u043a\u0438\u0435 \u0434\u0430\u043d\u043d\u044b\u0435 \u043f\u0440\u043e\u0442\u0438\u0432\u043e\u043f\u043e\u043b\u043e\u0436\u043d\u043e\u0433\u043e \u043f\u043e\u043b\u0430. \n\u2800 \n\u0418\u0441\u0445\u043e\u0434\u044f \u0438\u0437 \u044d\u0442\u043e\u0433\u043e \u0441\u043b\u0435\u0434\u0443\u0435\u0442, \u0447\u0442\u043e \u0432 \u043c\u043e\u0437\u0433\u0443 \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u0443\u0435\u0442 \u043d\u0435\u043a\u0430\u044f \u043e\u0431\u0449\u0430\u044f \u0441\u0438\u0441\u0442\u0435\u043c\u0430, \u043e\u043f\u0440\u0435\u0434\u0435\u043b\u044f\u044e\u0449\u0430\u044f \u0441\u0442\u0435\u043f\u0435\u043d\u044c \u043f\u0440\u0438\u0432\u043b\u0435\u043a\u0430\u0442\u0435\u043b\u044c\u043d\u043e\u0441\u0442\u0438 \u043f\u0440\u0435\u0434\u043c\u0435\u0442\u043e\u0432, \u0431\u0443\u0434\u044c \u0442\u043e \u0441\u0438\u043c\u043f\u0430\u0442\u0438\u0447\u043d\u044b\u0439 \u0442\u043e\u0440\u0442\u0438\u043a, \u043c\u0443\u0437\u044b\u043a\u0430 \u0438\u043b\u0438 \u043a\u0430\u0440\u0442\u0438\u043d\u0430. \u041f\u043e\u043b\u044c\u0437\u0443\u0439\u0442\u0435\u0441\u044c \u044d\u0442\u0438\u043c \u0441 \u0443\u043c\u043e\u043c \u0438 \u0432\u044b\u0431\u0438\u0440\u0430\u0439\u0442\u0435 \u0447\u0435\u043c \u0441\u0435\u0431\u044f \u043d\u0430\u043f\u043e\u043b\u043d\u044f\u0442\u044c \u0438 \u043a\u0430\u043a\u0443\u044e  \u044d\u0441\u0442\u0435\u0442\u0438\u043a\u0443 \u0440\u0430\u0437\u0432\u0438\u0432\u0430\u0442\u044c\ud83d\ude0e\n\u2800 \n\u0422\u0430\u043a\u0436\u0435 \u0443\u0432\u0435\u0440\u0435\u043d\u0430, \u0447\u0442\u043e \u043a\u0440\u0430\u0441\u043e\u0442\u0430 \u043d\u0435 \u0442\u043e\u043b\u044c\u043a\u043e \u0434\u043e 30 \u043a\u0442\u043e-\u0442\u043e \u043c\u043e\u0436\u0435\u0442 \u043d\u0430\u0434\u043e\u043b\u0433\u043e \u0437\u0430\u0432\u0438\u0441\u043d\u0443\u0442\u044c \u0432 \u0436\u0435\u0440\u0442\u0432\u0435, \u043a\u043e\u043f\u0430\u044f\u0441\u044c \u0432 \u0441\u0432\u043e\u0438\u0445 \u0442\u0440\u0430\u0432\u043c\u0430\u0445. \u0413\u043e\u0432\u043e\u0440\u044e \u043e\u0431 \u044d\u0442\u043e\u043c \u0438\u0437 \u043b\u0438\u0447\u043d\u043e\u0433\u043e \u043e\u043f\u044b\u0442\u0430. \u2028\u2800 \u2028\u042d\u0442\u043e \u043d\u0435 \u043e\u0437\u043d\u0430\u0447\u0430\u0435\u0442, \u0447\u0442\u043e \u043d\u0435 \u0441\u0442\u043e\u0438\u0442 \u043f\u0440\u043e\u0440\u0430\u0431\u043e\u0442\u0430\u0442\u044c \u0434\u0435\u0442\u0441\u0442\u0432\u043e \u0438 \u043f\u043e\u043d\u044f\u0442\u044c \u0441 \u0447\u0435\u0433\u043e \u043d\u0430\u0447\u0430\u043b\u043e\u0441\u044c \u0432\u0430\u0448\u0435 \u0444\u043e\u0440\u043c\u0438\u0440\u043e\u0432\u0430\u043d\u0438\u0435 \u0438 \u043e\u0442\u043a\u0443\u0434\u0430 \u043a\u043e\u0440\u043d\u0438 \u0432\u0441\u0435\u0445 \u0432\u0430\u0448\u0438\u0445 \u043f\u0440\u0438\u0432\u044b\u0447\u0435\u043a \u043c\u044b\u0448\u043b\u0435\u043d\u0438\u044f \u0441\u0435\u0439\u0447\u0430\u0441. \u041f\u0440\u043e\u0441\u0442\u043e \u043f\u043e\u043c\u043d\u0438\u0442\u0435, \u0447\u0442\u043e \u043d\u0430\u0448 \u043c\u043e\u0437\u0433 \u043a\u0430\u043a \u043a\u043e\u043c\u043f\u044c\u044e\u0442\u0435\u0440 \u0441\u0442\u0440\u043e\u0438\u0442 \u043f\u043e\u0442\u0435\u043d\u0446\u0438\u0430\u043b\u044c\u043d\u044b\u0435 \u0441\u0442\u0440\u0430\u0442\u0435\u0433\u0438\u0438 \u043d\u0430 \u0431\u0443\u0434\u0443\u0449\u0435\u0435, \u043e\u043f\u0438\u0440\u0430\u044f\u0441\u044c \u043d\u0430 \u0438\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0438\u044e, \u043a\u043e\u0442\u043e\u0440\u0443\u044e \u043c\u044b \u0432 \u043d\u0435\u0433\u043e \u0437\u0430\u0433\u0440\u0443\u0436\u0430\u0435\u043c. \u0414\u043e\u043b\u0433\u043e\u0435 \u0437\u0430\u0432\u0438\u0441\u0430\u043d\u0438\u0435 \u0432 \u043f\u0440\u043e\u0448\u043b\u043e\u043c \u0432\u0435\u0434\u0435\u0442 \u043a \u0434\u0435\u043f\u0440\u0435\u0441\u0441\u0438\u0438. \u0418 \u0442\u0430\u043c \u044f \u0442\u043e\u0436\u0435 \u0431\u044b\u043b\u0430.\n\u2800 \n\u0412 \u043a\u043e\u043d\u0446\u0435 \u043a\u043e\u043d\u0446\u043e\u0432 \u0432\u044b \u043f\u043e\u0439\u043c\u0435\u0442\u0435, \u0447\u0442\u043e \u0441\u0435\u043a\u0440\u0435\u0442 \u0441\u0447\u0430\u0441\u0442\u044c\u044f \u0438 \u0441\u0432\u043e\u0431\u043e\u0434\u044b \u0437\u0430\u043a\u043b\u044e\u0447\u0430\u0435\u0442\u0441\u044f \u043d\u0435 \u0432 \u043a\u043e\u043d\u0442\u0440\u043e\u043b\u0435 \u0441\u0438\u0442\u0443\u0430\u0446\u0438\u0438 \u0438\u043b\u0438 \u043c\u0435\u0441\u0442\u0438 \u0437\u0430 \u043e\u0431\u0438\u0434\u0443, \u0430 \u0432 \u0442\u043e\u043c, \u0447\u0442\u043e\u0431\u044b \u043f\u043e\u0437\u0432\u043e\u043b\u0438\u0442\u044c \u0441\u043e\u0431\u044b\u0442\u0438\u044f\u043c \u0440\u0430\u0437\u0432\u0438\u0432\u0430\u0442\u044c\u0441\u044f \u0435\u0441\u0442\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u043c \u043e\u0431\u0440\u0430\u0437\u043e\u043c \u0438 \u0443\u0447\u0438\u0442\u044c\u0441\u044f \u043d\u0430 \u0441\u0432\u043e\u0435\u043c \u043e\u043f\u044b\u0442\u0435 \u0441 \u0442\u0435\u0447\u0435\u043d\u0438\u0435\u043c \u0432\u0440\u0435\u043c\u0435\u043d\u0438. \u0421\u0430\u043c\u043e\u0435 \u0433\u043b\u0430\u0432\u043d\u043e\u0435 - \u044d\u0442\u043e \u043d\u0435 \u043f\u0435\u0440\u0432\u0430\u044f, \u0430 \u043f\u043e\u0441\u043b\u0435\u0434\u043d\u044f\u044f \u0433\u043b\u0430\u0432\u0430 \u0432\u0430\u0448\u0435\u0439 \u0436\u0438\u0437\u043d\u0438, \u043a\u043e\u0442\u043e\u0440\u0430\u044f \u0440\u0430\u0441\u043a\u0440\u044b\u0432\u0430\u0435\u0442 \u0434\u0435\u0442\u0430\u043b\u0438 \u0442\u043e\u0433\u043e, \u043d\u0430\u0441\u043a\u043e\u043b\u044c\u043a\u043e \u0445\u043e\u0440\u043e\u0448\u0
